import React, {useState} from 'react'
import Nav from '../components/Nav'

const Onboarding = () => {
  return (
    <>
      <Nav
        minimal = {true}
        setShowModal = {() => {}}
        showModal = {false}
      />
      <div className='onboarding'>
        <h2>CREATE ACCOUNT</h2>
          <form onSubmit={handleSubmit}>
            <section>
              <label>First Name</label>
            </section>
          </form>
      </div>
    </>
  )
}

export default Onboarding
